-- ----------------------------
--  Table structure for `iel_inventory`
-- ----------------------------
DROP TABLE IF EXISTS `iel_inventory`;
CREATE TABLE `iel_inventory` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `inventory_no` varchar(200) DEFAULT NULL,
  `begin_time` datetime DEFAULT NULL,
  `end_time` datetime DEFAULT NULL,
  `inventory_status` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `iel_inventory_detail`
-- ----------------------------
DROP TABLE IF EXISTS `iel_inventory_detail`;
CREATE TABLE `iel_inventory_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `inventory_id` int(11) DEFAULT NULL,
  `stock_id` int(11) DEFAULT NULL,
  `stock_num` int(11) DEFAULT NULL,
  `inventory_num` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
