-- ----------------------------
--  Table structure for `iel_transport`
-- ----------------------------
DROP TABLE IF EXISTS `iel_transport`;
CREATE TABLE `iel_transport` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `declare_num` varchar(100) DEFAULT NULL COMMENT '报关次数',
  `destination` varchar(200) DEFAULT NULL COMMENT '目的地',
  `arrival_list` varchar(2500) DEFAULT NULL COMMENT '配件到货清单',
  `purchase_list` varchar(2500) DEFAULT NULL COMMENT '到货清单,带采购价格',
  `sales_contract` varchar(2500) DEFAULT NULL COMMENT '公司-公司,销售合同',
  `invoice` varchar(2500) DEFAULT NULL COMMENT '发票/bl等清关文件',
  `purchase_contract` varchar(2500) DEFAULT NULL COMMENT '采购合同',
  `export_cost` varchar(2500) DEFAULT NULL COMMENT '出口成本',
  `sales_list` varchar(500) DEFAULT NULL COMMENT '到货清单,带销售价格',
  `entrance_cost` varchar(2500) DEFAULT NULL COMMENT '进口成本',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `ship_num` varchar(200) DEFAULT NULL,
  `zhu_ji_sales_list` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=94 DEFAULT CHARSET=utf8;

